INSERT INTO `cms_template` VALUES ('710670601912127488', 'banner', null, '/pc/include/index/banner.html', '710670118122336256', '2', '<!-- <div class=\"banner\">\r\n<div class=\"swiper-container\">\r\n  <div class=\"swiper-wrapper\">\r\n  <#cms_banner type=\"首页banner\" rows=\"3\";bans>\r\n   <%for(ban in bans){var pic=strutil.replace(ban.big_picurl,\'\\\\\',\'/\');%>\r\n    <div class=\"swiper-slide\"><img src=\"${pic}\"  onclick=\"window.location.href=\'${ban.href_url}\'\" style=\"cursor: pointer;\"></div>\r\n     <%}%>\r\n </#cms_banner>\r\n  </div>\r\n  <div class=\"swiper-pagination\"></div>\r\n</div>\r\n</div> -->\r\n<!-- banner -->\r\n<div id=\"box_top_sub3\">\r\n	<div class=\"columnSpace\"\r\n		id=\"elem-FrontPublic_slideShow01-1441866455619\">\r\n		<script language=\"javascript\">\r\n	//<![CDATA[\r\n		FrontPublic_slideShow01[\'FrontPublic_slideShow01-1441866455619_init\'] = function (){\r\n		 FrontPublic_slideShow01[\'FrontPublic_slideShow01-1441866455619_init\'] = new FrontPublic_slideShow01();\r\n		 FrontPublic_slideShow01[\'FrontPublic_slideShow01-1441866455619_init\'].d5_slide(\"960\",\"\");\r\n		}\r\n		$( FrontPublic_slideShow01[\'FrontPublic_slideShow01-1441866455619_init\']);\r\n	// ]]>\r\n</script>\r\n		<script type=\"text/javascript\" src=\"${ctxPath}/portal/js/superslide.2.1_1.js\"></script>\r\n		<div id=\"FrontPublic_slideShow01-1441866455619\"\r\n			class=\"FrontPublic_slideShow01-d6_c1\">\r\n			<div class=\"fullSlide\">\r\n				<div class=\"bd\">\r\n					<ul>\r\n						<li>\r\n						<a href=\"javascript:void(0)\" class=\"f_pic\"> <img src=\"${ctxPath}/portal/picture/408015b4-d497-4359-89cc-2756ef542263_1.jpg\" /></a> \r\n						<a href=\"javascript:void(0)\" class=\"f_title\"> </a>\r\n						</li>\r\n						<li><a href=\"javascript:void(0)\" class=\"f_pic\"> <img\r\n								src=\"${ctxPath}/portal/picture/d387012f-7c07-4e63-9656-60050f40e55f_1.jpg\" />\r\n						</a> <a href=\"javascript:void(0)\" class=\"f_title\"> </a></li>\r\n						<li><a href=\"javascript:void(0)\" class=\"f_pic\"> <img\r\n								src=\"${ctxPath}/portal/picture/4791577c-d2ea-4c90-b688-b2b0a2178eec_1.jpg\" />\r\n						</a> <a href=\"javascript:void(0)\" class=\"f_title\"> </a></li>\r\n					</ul>\r\n				</div>\r\n				<div class=\"hd\">\r\n					<ul></ul>\r\n				</div>\r\n				<span class=\"prev\"></span> <span class=\"next\"></span>\r\n			</div>\r\n			<script type=\"text/javascript\">\r\n$(\".fullSlide\").hover(function(){\r\n    $(this).find(\".prev,.next\").stop(true, true).fadeTo(\"show\", 0.5)\r\n},\r\nfunction(){\r\n    $(this).find(\".prev,.next\").fadeOut()\r\n});\r\n$(\".fullSlide\").slide({\r\n    titCell: \".hd ul\",\r\n    mainCell: \".bd ul\",\r\n    effect: \"fold\",\r\n    autoPlay: true,\r\n    autoPage: true,\r\n    trigger: \"click\",\r\n	interTime:\"5\"*1000,\r\n    startFun: function(i) {\r\n        var curLi = jQuery(\".fullSlide .bd li\").eq(i);\r\n        if ( !! curLi.attr(\"_src\")) {\r\n            curLi.css(\"background-image\", curLi.attr(\"_src\")).removeAttr(\"_src\")\r\n        }\r\n    }\r\n});\r\n</script>\r\n		</div>\r\n	</div>\r\n</div>\r\n', '2017-10-23 11:29:20', 'admin1', null, null);
