INSERT INTO `cms_template` VALUES ('710697100515479552', 'aboutbody', null, '/pc/include/aboutbody.html', '710667584770686976', '2', '  <div class=\"aboutwk\">\r\n    <div class=\"nmenu\">\r\n      <ul>\r\n        <li class=\"nmenuhover\"><a href=\"#\">公司简介</a></li>\r\n        <li><a href=\"#\">核心团队</a></li>\r\n        <li><a href=\"#\">受信责任</a></li>\r\n        <li><a href=\"#\">招贤纳士</a></li>\r\n        <li><a href=\"#\">联系我们</a></li>\r\n      </ul>\r\n    </div>\r\n    <div class=\"aboutnr\">\r\n    <center><img src=\"${ctxPath}/portal/images/about.JPG\" width=\"512\" height=\"170\"></center><br>富汇财富投资管理有限公司成立于2015年6月，总部位于上海，是一家中外合资的投资管理公司。其股东包括：富越汇通金融公司、国金创新投资公司等。<br>\r\n作为一家提供投资者独立的全球资产配置财富管理服务的公司，富汇财富致力于发展成为中国投资者全球布局的最佳导航者。<br>\r\n富汇财富提供的产品方案，包括境内外优质投资产品，并以高资产个人/家庭、电子交易客户这两类为主要目标群体。公司将专注于客户端的长期竞争优势，追求长期的最佳客户满意度—以客户需求为中心，而非产品销售导向的企业，提供对的方案给对的客户。<br>\r\n公司追求对整体社会贡献最大化。利益分配的顺序为：<br>\r\n1、客户回报<br>\r\n2、员工回报<br>\r\n3、社会回馈<br>\r\n4、股东分红<br>\r\n公司已于2015年9月完成中国证券业协会备案，私募投资基金管理人牌照登记编号为P1023825。第三方基金销售公司牌照的申请亦在筹备中。\r\n    </div>\r\n    <div class=\"clear\"></div>\r\n  </div>', '2017-10-23 11:29:20', 'admin1', null, null);
