INSERT INTO `cms_template` VALUES ('710727892377120768', 'newdetailbody', null, '/pc/include/new/newdetailbody.html', '710725777148190720', '2', '  <div class=\"newwk\">\r\n    <div class=\"newviewleft\">\r\n      <h1>市场洞见</h1>\r\n      <h2>环保经济过热背后的乱象：低价恶性竞争成烂尾</h2>\r\n      <span>一旦低价中标环保项目后续运营出现问题，不仅影响当地环境质量的改善，也将激化政企矛盾的集中爆发。</span><br>\r\n      <span class=\"uptime\">2016.3.8 12:21:18发布</span>\r\n      <div class=\"clear\"></div>\r\n      <div class=\"newview\">\r\n        <img src=\"${ctxPath}/portal/images/xwt.jpg\" style=\"width:100%;\"><br>\r\n        \"狼来了！\"这是环保企业在近期很多环保项目中标价格公布后的第一感觉。他们把这些低于成本的中标行为形容为\"野蛮人\"\"超越底线\"\"行业自毁\"……<br>\r\n\r\n\"一旦低价中标项目后续运营出现问题，不仅影响当地环境质量，也将激化政企矛盾。\"在3月1日全国工商联环境商会（下称环境商会）召开的\"环保企业家媒体见面会\"上，各界环保界人士直言，\"野蛮人\"的进入加剧了低价竞争，甚至一些企业在低价中标之后，运行一段时间就难以为继，又\"绑架\"地方政府提价。<br>\r\n\r\n低价恶性竞争的环保经济乱象与目前环保产业投资过热有很大关系。<br>\r\n\r\n在政策的驱动下，环保产业炙手可热，越来越多的非环保企业破门而入。<br>\r\n\r\n据环境商会统计，2015年环保行业的并购风起云涌，共发生案例约120起，涉及交易金额超400亿元。特别是大型国企进军成为新业态。葛洲坝集团、中国石化、中冶集团、徐工集团、中国铁建等都开始跨界布局环保市场。<br>\r\n\r\n\"可是任何事情热了以后就会出现问题，这些问题可能需要时间消化，难免就会有一些失败的案例和做法。\"环境商会会长赵笠钧向腾讯财经《棱镜》如此分析为何低价中标会引起环保界的争议。<br>\r\n\r\n多位环保业内专家向《棱镜》表示，恶性竞争的问题在于服务边界不清晰、监管不严格、调价机制不完善，以及背后的官商勾结等，这导致低价中标者低质运行无监管、调价暗箱操作等；最根本的还是引入市场化机制，鼓励通过技术进步和合理竞争降低价格。<br>\r\n\r\n不断被击穿的中标价<br>\r\n\r\n2015年9月，江苏省政府采购网发布《高邮市生活垃圾焚烧发电PPP项目预中标结果公示》，宣布天津泰达环保有限公司预中标江苏省高邮市生活垃圾焚烧发电PPP项目，项目总投资约3.5亿元，垃圾处理费中标金额为26.5元/吨。<br>\r\n\r\n\"狼来了！\"这创下了国内垃圾焚烧发电项目中标价新低。此前的2015年6月，光大国际以48元/吨的价格中标江苏新泰市生活垃圾焚烧发电项目；8月，绿色动力环保集团股份有限公司以26.8元/吨拿下安徽蚌埠垃圾焚烧发电项目。<br>\r\n\r\n然而3个月后，最低价格记录再一次被打破。\r\n\r\n\r\n      </div>\r\n    </div>\r\n    <div class=\"newviewright\"><img src=\"${ctxPath}/portal/images/we.JPG\"></div>\r\n   <div class=\"clear\"></div>\r\n  </div>', '2017-10-23 11:29:20', 'admin1', null, null);
